import { useEffect } from "react";

const Message = () => {

    const params = useParams();

    useEffect(() => {

        const fetchMessages = async () => {

            const response = await fetch('/api/' + params.recipient)
            const json = await response.json()

            if (response.ok) {

                setMessages(json)

            }

        }

        fetchMessages()

    })

    return (
        <h1>{params.id}</h1>
    )

}

export default Message
